0:1492:3034.docs:
Determine whether `Deserialize` implementations should expect to
deserialize their human-readable form.

Some types have a human-readable form that may be somewhat expensive to
construct, as well as a binary form that is compact and efficient.
Generally text-based formats like JSON and YAML will prefer to use the
human-readable one and binary formats like Postcard will prefer the
compact one.

```edition2021
# use std::ops::Add;
# use std::str::FromStr;
#
# struct Timestamp;
#
# impl Timestamp {
#     const EPOCH: Timestamp = Timestamp;
# }
#
# impl FromStr for Timestamp {
#     type Err = String;
#     fn from_str(_: &str) -> Result<Self, Self::Err> {
#         unimplemented!()
#     }
# }
#
# struct Duration;
#
# impl Duration {
#     fn seconds(_: u64) -> Self { unimplemented!() }
# }
#
# impl Add<Duration> for Timestamp {
#     type Output = Timestamp;
#     fn add(self, _: Duration) -> Self::Output {
#         unimplemented!()
#     }
# }
#
use serde::de::{self, Deserialize, Deserializer};

impl<'de> Deserialize<'de> for Timestamp {
    fn deserialize<D>(deserializer: D) -> Result<Self, D::Error>
    where
        D: Deserializer<'de>,
    {
        if deserializer.is_human_readable() {
            // Deserialize from a human-readable string like "2015-05-15T17:01:00Z".
            let s = String::deserialize(deserializer)?;
            Timestamp::from_str(&s).map_err(de::Error::custom)
        } else {
            // Deserialize from a compact binary representation, seconds since
            // the Unix epoch.
            let n = u64::deserialize(deserializer)?;
            Ok(Timestamp::EPOCH + Duration::seconds(n))
        }
    }
}
```

The default implementation of this method returns `true`. Data formats
may override this to `false` to request a compact form for types that
support one. Note that modifying this method to change a format from
human-readable to compact or vice versa should be regarded as a breaking
change, as a value serialized in human-readable mode is not required to
deserialize from the same data in compact mode.

0:1976:4095.docs:
Begin to serialize a variably sized sequence. This call must be
followed by zero or more calls to `serialize_element`, then a call to
`end`.

The argument is the number of elements in the sequence, which may or may
not be computable before the sequence is iterated. Some serializers only
support sequences whose length is known up front.

```edition2021
# use std::marker::PhantomData;
#
# struct Vec<T>(PhantomData<T>);
#
# impl<T> Vec<T> {
#     fn len(&self) -> usize {
#         unimplemented!()
#     }
# }
#
# impl<'a, T> IntoIterator for &'a Vec<T> {
#     type Item = &'a T;
#     type IntoIter = Box<dyn Iterator<Item = &'a T>>;
#
#     fn into_iter(self) -> Self::IntoIter {
#         unimplemented!()
#     }
# }
#
use serde::ser::{Serialize, SerializeSeq, Serializer};

impl<T> Serialize for Vec<T>
where
    T: Serialize,
{
    fn serialize<S>(&self, serializer: S) -> Result<S::Ok, S::Error>
    where
        S: Serializer,
    {
        let mut seq = serializer.serialize_seq(Some(self.len()))?;
        for element in self {
            seq.serialize_element(element)?;
        }
        seq.end()
    }
}
```

